import './stytle.scss'
import {useState} from "react";
import {INavigationType} from "../../type";

interface PropNavigation{
    item:INavigationType,
}

const NavigationItem = ({item}:PropNavigation) => {

const {id, img, value, active}=item

    const [state, setState] = useState("");

    return (

        <li onClick={():void=> setState(id)} className={active ? ("batman-store__header-container_navigation-list-item--active"):("batman-store__header-container_navigation-list-item")} onClick={()=> setState(id)}>{img ? (<img src={img} alt="HomeIco"/>) : null}
            {value}
        </li>
    )

}

export default NavigationItem
